import React from 'react'
import styled from 'styled-components';
import {ArrowRight} from "@mui/icons-material";

const Container = styled.div`
    margin-top: 41px;
    width:100%;
    height:100hv;
`

const Slider = () => {
    return (
      <Container>
          <Arrow>
              <ArrowRight/>
          </Arrow>
      </Container>
    )
}

export default Slider
